import useFetch from "../../hooks/useFetch";
import "./propertyList.css"

const PropertyList = () => {

    const {data, loading, error} = useFetch("/hotels/countByType")

    const images = [
        "https://media.cnn.com/api/v1/images/stellar/prod/220428100601-01-orbital-assembly-space-hotel.jpg?c=original",
        "https://media.cnn.com/api/v1/images/stellar/prod/220428100601-01-orbital-assembly-space-hotel.jpg?c=original",
        "https://media.cnn.com/api/v1/images/stellar/prod/220428100601-01-orbital-assembly-space-hotel.jpg?c=original",
        "https://media.cnn.com/api/v1/images/stellar/prod/220428100601-01-orbital-assembly-space-hotel.jpg?c=original",
        "https://media.cnn.com/api/v1/images/stellar/prod/220428100601-01-orbital-assembly-space-hotel.jpg?c=original"
    ]
    return(
        <div className="pList">
            {loading ? ("loading"): (<>
            {data && images.map(img => (
            <div className="pListItem">
                <img src={img} alt="" className="pListImg" />
                <div className="pListTitles">
                    <h1>Hotels</h1>
                    <h2>233 hotels</h2>
                </div>
            </div>))
            }
            </>)}
        </div>
    )
}

export default PropertyList;
